import React, { Component } from 'react'


const TableHead = () => {
    return (
        <thead>
          <tr>
            <th>Name</th>
            <th>Job</th>
          </tr>
        </thead>
    )
}
const TableBody = () => {
    return (
        <tbody />
    )
}

class Table extends Component {
  render() {
      const { characterData } = this.props
    return (
      <table>
        <TableHead />
        <TableBody characterData = {characterData} />
      </table>
    )
  }
}

export default Table
